import React, { useEffect } from "react";
import SearchField from "react-search-field";
import "./App.css";

export const ResultValue = (props) => {
  return <div className="box">{console.log(props.userData.map((data) => console.log(data[0], 'result')))}</div>;
};



const Result = () => {
  return (
    <div className="App">
      <div className="header">
        <h1>Report</h1>
      </div>
      <Search />

      <ResultValue />
    </div>
  );
};

export default Result;
